import * as React from "react";
import { Box } from "@mui/system";
import HistoricalChart from "./historical_data";


class Chart extends React.Component {

    render () {
        return (
            <Box sx={{
                boxShadow: 10,
                borderRadius: 10,
                p: 2,
                minWidth: 1200,
                minHeight: 1200,

            }} >
                <HistoricalChart />
                <div id="d3target" width="1200" height="1200" bgcolor="#880088"></div>            
            </Box>

        );
    };
};

export default Chart;
